To the best friend I could ever ask for…

June 5th 
@cruelsummer

So happy to announce that At The Gates was granted an interim agreement by SAG so that we can promote the film! Thank you @sagaftra for supporting small independent films and filmmakers and allowing us to get the word out about this incredible film! 

We shot this movie in November of 2021 with an ambitious shoot schedule and a cast and crew of people who were passionate about this story and making it happen. It’s a suspenseful and effective thriller but it also tells an incredibly important and heart wrenching story of our main characters, mother and son, who are undocumented immigrants from El Salvador. 

I’m very grateful to be a small part of this film and to help tell this story, thank you to our talented writer/director Augie for allowing me to be apart of this. 

After a long successful run at several film festivals in multiple countries, multiple awards, and the hard work of our team, we can now celebrate the limited theatrical release of the film AT THE GATES in NY and LA starting November 3rd! Please support this indie film, made with love and hard work by so many incredible people. Buy your tickets!! 
